<!DOCTYPE html>
<html lang='en'>
<head>
  <meta charset='UTF-8'>
  <title>KaTeX Math Symbols</title>
  <link rel='stylesheet' href='../lib/katex/katex.min.css'>
  <link rel='stylesheet' href='style.css'>
</head>
<body>
  <main>
    <div class='head'>
      <div class='container'>
        <h1 class='logo'>\KaTeX</h1>
        <h2>
          Supported symbols
        </h2>
      </div>
    </div>
    <div class="content">
      <div class='container'>
        <h1>Relation Symbols</h1>
        <div class='relation-symbols'></div>
        <h1>Binary Operators</h1>
        <div class='binary-operators'></div>
        <h1>Set and Logic Notation</h1>
        <div class='set-logic-notation'></div>
        <h1>Delimiters</h1>
        <div class='delimiters'></div>
        <h1>Greek Letters</h1>
        <div class='greek-letters'></div>
        <h1>Other</h1>
        <div class='other'></div>
        <h1>Trigonometric Functions</h1>
        <div class='trig'></div>
      </div>
    </div>
  </main>
  <script src='../lib/katex/katex.min.js'></script>
  <script src='../dist/script.js'></script>
</body>
</html>
